INSERT INTO `novel` VALUES ('1', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\1', '圣墟', '辰东', '玄幻小说', '在破败中崛起，在寂灭中复苏。 <br> 沧海成尘，雷电枯竭，那一缕幽雾又一次临近大地，世间的枷锁被打开了，一个全新的世界就此揭开神秘的一角……', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\1\\1.jpg', '2018-05-22 03:58:33', '2018-05-22 03:58:33', '0', '连载', '0');
INSERT INTO `novel` VALUES ('2', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\2', '我是至尊', '风凌天下', '玄幻小说', '药不成丹只是毒，人不成神终成灰。 <br> ………… <br> 天道有缺，人间不平，红尘世外，魍魉横行；哀尔良善，怒尔不争；规则之外，吾来执行。 <br> 布武天下，屠尽不平；手中有刀，心中有情；怀中美人，刀下奸雄；冷眼红尘，无憾今生。 <br> …… <br> 惊天智谋，踏破国仇家恨；铁骨柔肠，演绎爱恨情仇；绝世神功，屠尽人间不平；丹心碧血，谱写兄弟千秋！', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\2\\2.jpg', '2018-05-22 03:58:39', '2018-05-22 03:58:39', '0', '连载', '0');
INSERT INTO `novel` VALUES ('3', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\3', '一念永恒', '耳根', '修真小说', '一念成沧海，一念化桑田。一念斩千魔，一念诛万仙。唯我念……永恒', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\3\\3.jpg', '2018-05-22 03:58:42', '2018-05-22 03:58:42', '0', '连载', '0');
INSERT INTO `novel` VALUES ('4', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\4', '不朽凡人', '鹅是老五', '修真小说', '我，只有凡根，一介凡人！ <br> 我，叫莫无忌！ <br> 我，要不朽！ <br>', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\4\\4.jpg', '2018-05-22 03:58:47', '2018-05-22 03:58:47', '0', '连载', '0');
INSERT INTO `novel` VALUES ('5', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\5', '绝世天君', '高楼大厦', '玄幻小说', '少年郑十翼天生无双神魂，却被祖地霸道夺取，偶得神秘通天青藤，踏上传奇之路！公道？很多人已经不讲了……可我！还讲！所以……我来拿回本该属于我的一切，我来创造那本该由我创造的传奇——郑十翼这里有最热血的故事，这里有最刚硬的骨头，这里有最挺拔的脊梁，这里还有动人的情谊！一个属于高楼大厦的故事，一段为热血，友情而诞生的传奇。', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\5\\5.jpg', '2018-05-22 03:58:52', '2018-05-22 03:58:52', '0', '连载', '0');
INSERT INTO `novel` VALUES ('6', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\6', '焚天之怒', '妖夜', '玄幻小说', '一个从小被封印的家族少年。一部可以兼融一切的无名功法。天星界诸王争霸，群雄并起，万族林立。自觉醒封印的那一刻起，诸界便在他脚下颤抖！同名游戏火热筹备中……', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\6\\6.jpg', '2018-05-22 03:58:57', '2018-05-22 03:58:57', '0', '连载', '0');
INSERT INTO `novel` VALUES ('7', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\7', '大主宰', '天蚕土豆', '玄幻小说', '其实接下来的新书，在斗破完结时便已经是有了构想，只不过却并未立即开始写，因为那个世界太过的宏伟浩大，所以，我再写了一本武动，来作为其基石。斗破大结局时，萧炎所去的新世界，与林动最终去往的神秘世界，是相同的，因为那个神秘的大世界，便是我们新书开始的地方。当初并不太认为自己有驾驭那个世界的能力，而现在，终归是可以开始了。', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\7\\7.jpg', '2018-05-22 03:59:06', '2018-05-22 03:59:06', '0', '连载', '0');
INSERT INTO `novel` VALUES ('8', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\8', '夜天子', '月关', '历史小说', '他世袭罔替，却非王侯；他出身世家，却非高门。作为六扇门中的一个牢头儿，他本想老老实实把祖上传下来的这只铁饭碗一代代传承下去，却不想被一个神棍忽悠出了那一方小天地，这一去，便是一个太岁横空出世。他自诩义薄云天，为人四海，是个可以托妻献子的好朋友，可他所到之处，却是家有佳妇贵女者统统藏之深闺不敢示人；他自称秉性纯良，与人为善。可是只为逃避做他的上司，堂堂江宁布政便打起“丁忧”的幌子，欢天喜地的辞官归故里了；他自谓忠臣，光霁日月，可一向勤政的万历皇帝却因他而再不早朝。杨凌人称杨砍头，杨帆人称瘟郎中，他却有着更多的绰号，疯典史、驴推官、夜天子……，每一个绰号，都代表着他的一个传奇。各位书友要是觉得《夜天子》还不错的话请不要忘记向您群和微博里的朋友推荐哦！', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\8\\8.jpg', '2018-05-22 03:59:12', '2018-05-22 03:59:12', '0', '连载', '0');
INSERT INTO `novel` VALUES ('9', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\9', '元尊', '天蚕土豆', '玄幻小说', '', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\9\\9.jpg', '2018-05-22 03:59:16', '2018-05-22 03:59:16', '0', '连载', '0');
INSERT INTO `novel` VALUES ('10', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\10', '全职法师', '乱(书坊)', '玄幻小说', '一觉醒来，世界大变。熟悉的高中传授的是魔法，告诉大家要成为一名出色的魔法师。居住的都市之外游荡着袭击人类的魔物妖兽，虎视眈眈。崇尚科学的世界变成了崇尚魔法，偏偏有着一样以学渣看待自己的老师，一样目光异样的同学，一样社会底层挣扎的爸爸，一样纯美却不能走路的非血缘妹妹……不过，莫凡发现绝大多数人都只能够主修一系魔法，自己却是全系全能法师！各位书友要是觉得《全职法师》还不错的话请不要忘记向您群和微博里的朋友推荐哦！全职法师最新章节,全职法师无弹窗,全职法师全文阅读', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\10\\10.jpg', '2018-05-22 03:59:17', '2018-05-22 03:59:17', '0', '连载', '0');
INSERT INTO `novel` VALUES ('11', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\11', '超级神基因', '十二翼黑暗炽天使', '玄幻小说', '未来波澜壮阔的星际时代，人类终于攻克了空间传送技术，可是当人类传送到另一端的时候，却发现那里并不是过去未来，也不是星空下的任何一片土地…… <br> 神秘的庇护所世界，无数强横的异生物，人类迎来了令人热血沸腾的飞跃性大进化，开启了星空下最辉煌璀璨的新纪元。 <br> “猎杀神血生物黑甲虫，获得神血黑甲虫兽魂，食用神血黑甲虫血肉，可随机获得0至10点神基因。” <br>', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\11\\11.jpg', '2018-05-22 03:59:25', '2018-05-22 03:59:25', '0', '连载', '0');
INSERT INTO `novel` VALUES ('12', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\12', '雪鹰领主', '我吃西红柿', '玄幻小说', '在帝国的安阳行省，有一个很小很不起眼的贵族领地，叫——雪鹰领！故事，就从这里开始！', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\12\\12.jpg', '2018-05-22 03:59:35', '2018-05-22 03:59:35', '0', '连载', '0');
INSERT INTO `novel` VALUES ('13', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\13', '牧神记', '宅猪', '玄幻小说', '大墟的祖训说，天黑，别出门。 <br> 大墟残老村的老弱病残们从江边捡到了一个婴儿，取名秦牧，含辛茹苦将他养大。这一天夜幕降临，黑暗笼罩大墟，秦牧走出了家门…… <br> 做个春风中荡漾的反派吧！ <br> 瞎子对他说。 <br> 秦牧的反派之路，正在崛起！', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\13\\13.jpg', '2018-05-22 03:59:41', '2018-05-22 03:59:41', '0', '连载', '0');
INSERT INTO `novel` VALUES ('14', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\14', '人道至尊', '宅猪', '玄幻小说', '　　自盘古开天，三皇治世，五帝定伦，世界之间，人为天地灵长……此时正值三皇中的人皇末期，五帝未定，人族也不是天地灵长。这里是莽苍荒蛮的时代，妖神、邪神、天神，诸神林立，妖魔、邪魔、天魔，群魔乱舞；万族并存，野蛮生长，统治天下，而人皇已老，人族弱小，被当成祭牲和食粮……这不是洪荒，而是狂野奔放的蛮荒！回归中国古典神话，书写人族逆袭的蛮荒传奇，敬请阅读《人道至尊》！', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\14\\14.jpg', '2018-05-22 03:59:44', '2018-05-22 03:59:44', '0', '连载', '0');
INSERT INTO `novel` VALUES ('15', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\15', '帝霸', '厌笔萧生', '玄幻小说', '千万年前，李七夜栽下一株翠竹。八百万年前，李七夜养了一条鲤鱼。五百万年前，李七夜收养一个小女孩。…………………………今天，李七夜一觉醒来，翠竹修练成神灵，鲤鱼化作金龙，小女孩成为九界女帝。这是一个养成的故事，一个不死的人族小子养成了妖神、养成了仙兽、养成了女帝的故事', 'C:\\Users\\huayanh\\git\\NovelWeb\\src\\main\\webapp\\data\\15\\15.jpg', '2018-05-22 03:59:50', '2018-05-22 03:59:50', '0', '连载', '0');
